import { Component, OnInit } from '@angular/core';
import { EventService, Event } from '../services copy/event.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-delete-event',
  templateUrl: './delete-event.component.html',
  styleUrls: ['./delete-event.component.css']
})
export class DeleteEventComponent implements OnInit {

  events: Event[] = [];
  selectedEventId: number | null = null;
  event: Event | null = null;

  constructor(private eventService: EventService, private router: Router) {}

  ngOnInit(): void {
    this.loadEvents();
  }

  loadEvents() {
    this.eventService.getEvents().subscribe((data) => (this.events = data));
  }

  onSelectEvent() {
    if (this.selectedEventId !== null) {
      this.eventService.getEventById(this.selectedEventId).subscribe((data) => {
        this.event = data;
      });
    }
  }

  deleteEvent() {
    if (this.selectedEventId !== null) {
      if (confirm('Are you sure you want to delete this event?')) {
        this.eventService.deleteEvent(this.selectedEventId).subscribe(() => {
          alert('Event deleted successfully!');
          this.router.navigate(['/view-event']);
        }, (err) => {
          console.error('Error deleting event:', err);
          alert('Failed to delete event.');
        });
      }
    }
  }
}
<div class="form-container">
  <h2>Delete Event</h2>

  <!-- Step 1: Select Event -->
  <label>Select Event to Delete</label>
  <select [(ngModel)]="selectedEventId" name="selectedEventId" (change)="onSelectEvent()" required>
    <option value="" disabled selected>Select an Event</option>
    <option *ngFor="let e of events" [value]="e.eventId">{{ e.courseTitle }}</option>
  </select>

  <!-- Step 2: Show details and delete button -->
  <div *ngIf="event">
    <p><strong>Course Title:</strong> {{ event.courseTitle }}</p>
    <p><strong>Topic ID:</strong> {{ event.topicId }}</p>
    <p><strong>Location ID:</strong> {{ event.locationId }}</p>
    <p><strong>Speaker ID:</strong> {{ event.speakerId }}</p>
    <p><strong>Class Size:</strong> {{ event.classSize }}</p>
    <p><strong>Number of Days:</strong> {{ event.numberOfDays }}</p>
    <p><strong>Start Date:</strong> {{ event.startDate | date }}</p>
    <p><strong>End Date:</strong> {{ event.endDate | date }}</p>

    <button (click)="deleteEvent()">Delete Event</button>
  </div>
</div>
